__NUXT_JSONP__("/drugs/ADH-1", (function(a,b,c){return {data:[{drug:{slug:a,emaEpar:[],fdaDrugLabel:[],id:a,nciThesaurus:{casRegistry:b,chebiId:b,chemicalFormula:b,definition:"A small, cyclic pentapeptide vascular-targeting agent with potential antineoplastic and antiangiogenic activities. ADH-1 selectively and competitively binds to and blocks N-cadherin, which may result in disruption of tumor vasculature, inhibition of tumor cell growth, and the induction of tumor cell and endothelial cell apoptosis. N-cadherin, a cell- surface transmembrane glycoprotein of the cadherin superfamily of proteins involved in calcium-mediated cell-cell adhesion and signaling mechanisms; may be upregulated in some aggressive tumors and the endothelial cells and pericytes of some tumor blood vessels.",fdaUniiCode:"B058ME29VU",identifier:"C53399",preferredName:a,semanticType:"Organic Chemical",subclassOf:["C1971"],synonyms:[a,"Exherin"]},dir:"\u002Fdrugs",path:"\u002Fdrugs\u002FADH-1",extension:".json",createdAt:c,updatedAt:c}}],fetch:{},mutations:void 0}}("ADH-1","","2021-10-30T13:40:39.203Z")));